import React from 'react';
import styled from 'styled-components';

const RowHour = styled.div`
  height: 40px;
  width: 1200px;
  display: flex;
  flex-direction: row;
  margin-left: 40px;
`;

const LeftContainer = styled.div`
  border: 1px solid #c8c8c8;
  width: 10px;
  border-top: 0px;
  border-left: 0px;
`;
const RightContainer = styled.div`
  border: 1px solid #c8c8c8;
  width: 1400px;
  border-top: 0px;
  border-right: 0px;
  border-left: 0px;
`;

const ContainerText = styled.div`
  position: absolute;
  left: 20px;
  width: 40px;
  padding-top: ${IsTypeHour ? '20px' : '30px'};
  text-align: right;
  font-size: 11px;
`;

const LineHour = (props) => {
  return (
    <div>
      <RowHour>
        <LeftContainer>
          <ContainerText>
            <span>
              {props.text}
            </span>
          </ContainerText>
        </LeftContainer>
        <RightContainer></RightContainer>
      </RowHour>
    </div>
  )
}

export default LineHour;
